// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract EtherReceiver {
    uint256 public balance;

    // Function to deposit Ether into the contract
    function deposit() external payable {
        balance += msg.value; // Update the balance with the amount of Ether sent
    }

    // Function to get the contract balance in wei
    function getBalanceInWei() external view returns (uint256) {
        return address(this).balance;
    }

    // Function to get the contract balance in gwei
    function getBalanceInGwei() external view returns (uint256) {
        return address(this).balance / 1 gwei;
    }

    // Function to get the contract balance in ether
    function getBalanceInEther() external view returns (uint256) {
        return address(this).balance / 1 ether;
    }

    // Special receive function to accept plain Ether transfers
    receive() external payable {
        balance += msg.value; // Update the balance with the amount of Ether sent
    }
}

